import React, { useState } from 'react';
import { Search as SearchIcon, Image } from 'lucide-react';

const SearchBar = () => {
  const [searchTerm, setSearchTerm] = useState('');

  return (
    <div className="flex items-center mb-6">
      <div className="relative flex-grow">
        <SearchIcon 
          size={20} 
          className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-500" 
        />
        <input 
          type="text" 
          placeholder="What are you looking for?" 
          className="w-full pl-10 pr-3 py-2 border rounded focus:outline-none focus:ring-2 focus:ring-green-500"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
      </div>
      <button className="ml-2 flex items-center bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600">
        <Image size={20} className="mr-2" />
        Search by image
      </button>
    </div>
  );
};

export default SearchBar;
